int main()
{ int testInteger = 5; printf("Number = %d", testInteger); return 0;
} Write out and ctrl+x and press enter twice. Run the script again... $ ./inputoutput.exe What happened? Well we need to recompile the code. $ gcc inputoutput.c -o inputoutput.exe
